text:
 @Jo89944  amigo, é porque você é modinha... Na época eu fui assistir o jogo do tricolor na série B paulista... Nos ingressos estava escrito série B.

Em teoria era tudo primeira divisão, assim como é hoje. As 3 primeiras divisões do paulistas são chamadas de primeira divisão. Mas na prática, o que a gente viu era que o São Paulo está em um grupo separado e mais fraco...

Não caiu na teoria, mas caiu na prática.

 @Changes08212  Tá bravinho é 🤣🤣🤣

Não existe retrospecto de 2007 a 2018 e pode chorar mais ai, você está tentando criar argumentos para me questionar e está falhando.

Você quer discutir comigo e nem sabe o que é fax? E que o São Paulo não estava envolvido nos pontos corridos em 2003? Patético 🤣🤣🤣🤣

 @Changes08212  Outro argumento patético..

Primeiro que entenda, quem faz a linha não é nenhuma máquina ou inteligência artificial, e sim uma pessoa, o computador serve apenas para um parâmetro, para que você possa ter noção do lance, e com isso o var (a pessoa) traça a linha e toma a decisão. Ou seja, você acha mesmo que isso garante algo, ou você é energúmeno o suficiente para não entender? Por acaso você acha que toda essa reclamação da arbitragem brasileira é tudo por incompetência dos times que não saíram com a vitória, e sim do var ou da arbitragem que comete um erro gravíssimo e ocasiona a decisão de um jogo? 
Você por acaso sofre de problemas, ou só é um modinha clubista que não aceita que seu time foi beneficiado ?

 @Changes08212  Irmão, time reserva e time reserva.

Mas no Maracanã o time de vocês já tava bem formado sim. Idai que tava retrancando, a obrigação é de vocês em fazer gols. 

Posso fazer nada se a maior parte da torcida de vocês considerarem o elenco de 2019 do Jorge Jesus melhor que o elenco de 1981 de Zico. Já que é sua própria torcida que diz isso.

 @Changes08212  Não importa, reserva e reserva.

Mas o São Paulo não perdeu então pronto, time do Flamengo era infinitamente melhor que o São Paulo em 2019.



Não é pelo que eu vi não amigão, todos os flamenguistas que eu discuti, comentava que 2019 foi o melhor time e a melhor época que o Flamengo teve, inclusive, tenho um amigo meu flamenguista que diz que o Zico não jogou nada, que ele é um jogador superestimado. E sim, a maioria dos flamenguistas que vejo falam que 2019 é o melhor elenco e isso é um fato, queira você ou não. Isso demanda também por a maioria torcida do seu time ser modinha e ter começado a assistir o time em 2019.
